  if ($ActionType=="Exit") usqlQuery = 'SELECT DISTINCT DATETIME(endTime,  "MM-dd HH:mm:ss","'+chartInterval+'") AS "Date", count(*) AS "Count", avg(duration) AS "Duration" from useraction WHERE useraction.application in ('+appsList+') and usersession.starttime>='+startTime+' and usersession.endtime<='+endTime+' and isexitaction is true limit 5000';
