  if ($ActionType=="Exit") usqlQuery = 'SELECT DISTINCT DATETIME(endTime,  "MM-dd HH:mm:ss","'+chartInterval+'") AS "Date", count(*) AS "Count", avg('+metric+') AS "Metric" from useraction WHERE useraction.application in ('+appsList+') and usersession.starttime>='+startTime+' and usersession.endtime<='+endTime+' and isexitaction is true limit 5000';
  const response = await rumUserSessionsClient.getUsqlResultAsTable({query: usqlQuery, startTimestamp: startTime, endTimestamp: endTime});
  if (response.values.length<6) return "Try increasing the timeframe.";
  const sampleCount = response.values.length-5;
  let percentChangeMetric = 0;
  let percentChangeTraffic = 0;
