  }
  let i2 = 0;
  let i2A = 0;
  let i2B = 0;
  while (i2 < sampleCount) {
    if (response.values[i2][1]>(trafficAVG/sampleCount))
      {
        metricAAVG=metricAAVG+response.values[i2][2];
        trafficAAVG=trafficAAVG+response.values[i2][1];
        i2A++;
      }
    if (response.values[i2][1]<(trafficAVG/sampleCount)) 
      {
        metricBAVG=metricBAVG+response.values[i2][2];
        trafficBAVG=trafficBAVG+response.values[i2][1];
        i2B++;
      }
    i2++;
  }
  percentChangeMetric = (Number(metricAAVG/i2A) - Number(metricBAVG/i2B))/Number(metricBAVG/i2B)*100;
  percentChangeTraffic = (Number(trafficAAVG/i2A) - Number(trafficBAVG/i2B))/Number(trafficBAVG/i2B)*100;
  let newChangeMetric = (percentChangeMetric+((percentChangeMetric*$TrafficChangePercent/100))).toFixed(2);
  var predictedMetric=((metricAVG/sampleCount+((metricAVG/sampleCount)*((percentChangeMetric+((percentChangeMetric*$TrafficChangePercent/100)))/100))));
  if (predictedMetric<0) predictedMetric=0;
  if (newChangeMetric>3) 
    {
      return metricName+" is "+Number(metricAVG/sampleCount).toFixed(2)+". Predicted "+metricName+" is "+(predictedMetric).toFixed(2)+" modeled with a "+$TrafficChangePercent+"% traffic increase.";
    }
  if (newChangeMetric<-3)
